import { Typography } from '@material-tailwind/react';

const Home = () => {
  return (
   
      <div relative flex h-screen content-center items-center justify-center pt-2 pb-32>
      <img src="https://th.bing.com/th/id/R.02e8506254c229be260b317461a1d6bc?rik=7Ra%2borddD8nopg&riu=http%3a%2f%2fwww.kapitalis.com%2fanbaa-tounes%2fwp-content%2fuploads%2f2019%2f11%2fMall-Of-Sousse.jpg&ehk=mnv%2b8pFeaOv%2fw6%2f63BrH8Q0DJfTOvPv5f%2fm2tJBRaHc%3d&risl=&pid=ImgRaw&r=0" alt="example" />
    </div>
  
  );
};

export default Home;
